function TriggerJob(n,t){axios.post("/api/service/job",{Name:n,GroupName:t})}var mainTable;$(function(){mainTable=$("#mainTable").DataTable({responsive:!0,serverSide:!1,searchDelay:500,lengthMenu:[10,15,20],ajax:{url:"/api/service/jobs",dataSrc:""},columns:[{data:"groupName"},{data:"name"},{width:70,orderable:!1,render:function(n,t,i){return`<button type="button" class="btn btn-sm btn-info ml-2 mr-2" onclick="TriggerJob('${i.name}', '${i.groupName}')">Trigger</button>`}}],columnDefs:[{className:"text-center ",targets:[-1]},],order:[[0,"DESC"]]})});